import React from 'react'
import { IProduct } from '../moduls'

interface ProductProps{
    product: IProduct
}

export function Home(props: ProductProps){
    return (
        <div>
            {props.product.title}
            <br/>
            {props.product.description}
            <br/>
            {props.product.price}
            <br/>
            {props.product.imageMain}
        </div>
    )
}
